contract HellLUNA is ERC20, Ownable {
   
    mapping(address => bool) public dexRouters;
    mapping(address => bool) public automatedMarketMakerPairs;

    IUniswapV2Router02 public defaultDexRouter;
    address public defaultPair;
    
    uint256 private _startSupply = 1000000000 * (10**9);
    uint256 private swapTokensAtAmount = 2400 * (10**9);
    uint8  private constant _decimals = 9;
    
    address public dev; 
    address public marketing;
    address public liquidityWallet;
    address public farm;

    bool private isSwappingFees;

    uint256 public maxWalletToken = 20 * (10**6) * (10**9); // 2% of total supply


    // fees (from a total of 10000)
    uint256 public buyFeesCollected = 0;
    uint256 public buyLiquidityFee = 300;
    uint256 public buyDevFee = 100;
    uint256 public buyMarketingFee = 600;
    uint256 public buyTotalFees = buyLiquidityFee + buyDevFee + buyMarketingFee;

    uint256 public sellFeesCollected = 0;
    uint256 public sellLiquidityFee = 300;
    uint256 public sellDevFee = 100;
    uint256 public sellMarketingFee = 600;
    uint256 public sellTotalFees = sellLiquidityFee + sellDevFee + sellMarketingFee;


    // exlcude from fees and max transaction amount
    mapping(address => bool) private _isExcludedFromFees;


    event UpdateDefaultDexRouter(address indexed newAddress, address indexed oldAddress);
    event ExcludeFromFees(address indexed account, bool isExcluded);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);
    event devUpdated(address indexed newDev, address indexed oldDev);
    event marketingUpdated(address indexed newMarketing, address indexed oldMarketing);
    event LiquidityWalletUpdated(address indexed newLiquidityWallet, address indexed oldLiquidityWallet);
    event SwapAndLiquify(uint256 tokensSwapped, uint256 ethReceived, uint256 tokensIntoLiqudity);
 

    constructor(
        address _routerAddress,
        address _dev,
        address _marketing
    ) ERC20("HellLUNA", "LUNAH") {
        IUniswapV2Router02 _dexRouter = IUniswapV2Router02(_routerAddress);
        
        dev = _dev;
        marketing = _marketing;
        liquidityWallet = owner();
        

        defaultDexRouter = _dexRouter;
        dexRouters[_routerAddress] = true;
        defaultPair = IUniswapV2Factory(_dexRouter.factory()).createPair(address(this), _dexRouter.WETH());
        
        _setAutomatedMarketMakerPair(defaultPair, true);
       
        _mint(owner(), _startSupply);
    }


    receive() external payable {}

    function decimals() public pure override returns (uint8) {
        return _decimals;
    }


    function addNewRouter(address _router, bool makeDefault) external onlyOwner {
        dexRouters[_router] = true;

        if (makeDefault) {
            emit UpdateDefaultDexRouter(_router, address(defaultDexRouter));
            defaultDexRouter = IUniswapV2Router02(_router);
            defaultPair = IUniswapV2Factory(defaultDexRouter.factory()).createPair(address(this), defaultDexRouter.WETH());
            _setAutomatedMarketMakerPair(defaultPair, true);
        }
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        require(_isExcludedFromFees[account] != excluded, "Account is already the value of 'excluded'");
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) external onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            excludeFromFees(accounts[i], excluded);
        }
    }

    function setAutomatedMarketMakerPair(address pair, bool value) external onlyOwner {
        require(
            value || pair != defaultPair,
            "The default pair cannot be removed from automatedMarketMakerPairs"
        );
        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        require(
            automatedMarketMakerPairs[pair] != value,
            "Automated market maker pair is already set to that value"
        );

        automatedMarketMakerPairs[pair] = value;
        emit SetAutomatedMarketMakerPair(pair, value);
    }


    function updateDev(address newDev) external onlyOwner {
        require(newDev != dev, "The dev wallet is already this address");
        emit devUpdated(newDev, dev);
        dev = newDev;
    }

    function updateMaxWallet(uint256 _newMax) external onlyOwner {
        maxWalletToken = _newMax;
    }

    function updateMarketing(address newMarketing) external onlyOwner {
        require(newMarketing != marketing, "The marketing wallet is already this address");
        emit devUpdated(newMarketing, marketing);
        marketing = newMarketing;
    }

    function updateLiquidityWallet(address newLiquidityWallet) external onlyOwner {
        require(newLiquidityWallet != liquidityWallet, "The liquidity wallet is already this address");
        emit LiquidityWalletUpdated(newLiquidityWallet, liquidityWallet);
        liquidityWallet = newLiquidityWallet;
    }


    function isExcludedFromFees(address account) external view returns (bool) {
        return _isExcludedFromFees[account];
    }


    function updateBuyFees(
        uint256 _liquidityFee,
        uint256 _devFee,
        uint256 _marketingFee
    ) external onlyOwner {
        buyLiquidityFee = _liquidityFee;
        buyDevFee = _devFee;
        buyMarketingFee = _marketingFee;
        buyTotalFees = buyLiquidityFee + buyDevFee + buyMarketingFee;
    }

    function updateSellFees(
        uint256 _liquidityFee,
        uint256 _devFee,
        uint256 _marketingFee
    ) external onlyOwner {
        sellLiquidityFee = _liquidityFee;
        sellDevFee = _devFee;
        sellMarketingFee = _marketingFee;
        sellTotalFees = sellLiquidityFee + sellDevFee + sellMarketingFee;
    }

    function updateSwapTokensAtAmount(uint256 _swapTokensAtAmount) external onlyOwner {
        require(_swapTokensAtAmount > 0, "Amount should be higher than 0");
        swapTokensAtAmount = _swapTokensAtAmount;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        uint256 senderBalance = balanceOf(from);
        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");

        if (
            from != owner() &&
            to != owner() &&
            to != address(0) &&
            to != 0x000000000000000000000000000000000000dEaD &&
            !automatedMarketMakerPairs[to]
        ) {
            uint256 contractBalanceRecepient = balanceOf(to);
            require(
                contractBalanceRecepient + amount <= maxWalletToken,
                "HellLUNAH: Exceeds maximum wallet token amount."
            );
        }

        // take fee
        amount = collectFees(from, to, amount);

        // swap fees before transfer has happened and after dividend balances are done
        swapFeesIfAmountIsReached(from, to);

        super._transfer(from, to, amount);
    }

    function collectFees(
        address from,
        address to,
        uint256 amount
    ) private returns (uint256) {
        if (!isSwappingFees && !_isExcludedFromFees[from] && !_isExcludedFromFees[to]) {
            uint256 fees;
            if (automatedMarketMakerPairs[from]) {
                fees = (amount * buyTotalFees) / 10000;
                buyFeesCollected += fees;
            } else if (automatedMarketMakerPairs[to]) {
                fees = (amount * sellTotalFees) / 10000;
                sellFeesCollected += fees;
            }

            amount = amount - fees;
            super._transfer(from, address(this), fees);
        }
        return amount;
    }

    function swapFeesIfAmountIsReached(address from, address to) private {
        uint256 contractTokenBalance = balanceOf(address(this));
        
        if (
            contractTokenBalance >= swapTokensAtAmount &&
            !isSwappingFees &&
            !automatedMarketMakerPairs[from] && // do not swap fees on buys
            from != liquidityWallet &&
            to != liquidityWallet
        ) {
            isSwappingFees = true;

            buyFeesCollected = (contractTokenBalance / (buyFeesCollected + sellFeesCollected)) * buyFeesCollected;
            sellFeesCollected = contractTokenBalance - buyFeesCollected;

            uint256 devTokens = (buyFeesCollected * buyDevFee) / buyTotalFees;
            devTokens += (sellFeesCollected * sellDevFee) / sellTotalFees;
            if (devTokens > 0) swapAndSendToFeeDev(devTokens);

            uint256 marketingTokens = (buyFeesCollected * buyMarketingFee) / buyTotalFees;
            marketingTokens += (sellFeesCollected * sellMarketingFee) / sellTotalFees;
            if (marketingTokens > 0) swapAndSendToFeeMarketing(marketingTokens);

            uint256 swapTokens = (buyFeesCollected * buyLiquidityFee) / buyTotalFees;
            swapTokens = (sellFeesCollected * sellLiquidityFee) / sellTotalFees;
            if (swapTokens > 0) swapAndLiquify(swapTokens);

            buyFeesCollected = 0;
            sellFeesCollected = 0;

            isSwappingFees = false;
        }
    }

    function swapAndSendToFeeDev(uint256 tokens) private {
        uint256 initialETHBalance = address(this).balance;
        swapTokensForEth(tokens);
        uint256 newETHBalance = address(this).balance - initialETHBalance;
        payable(dev).transfer(newETHBalance);
    }

    function swapAndSendToFeeMarketing(uint256 tokens) private {
        uint256 initialETHBalance = address(this).balance;
        swapTokensForEth(tokens);
        uint256 newETHBalance = address(this).balance - initialETHBalance;
        payable(marketing).transfer(newETHBalance);
    }

    function swapAndLiquify(uint256 tokens) private {
        // split the contract balance into halves
        uint256 half = tokens / 2;
        uint256 otherHalf = tokens - half;

        // capture the contract's current ETH balance.
        // this is so that we can capture exactly the amount of ETH that the
        // swap creates, and not make the liquidity event include any ETH that
        // has been manually sent to the contract
        uint256 initialBalance = address(this).balance;

        // swap tokens for ETH
        swapTokensForEth(half); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance - initialBalance;

        // add liquidity to uniswap
        addLiquidity(otherHalf, newBalance);

        emit SwapAndLiquify(half, newBalance, otherHalf);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = defaultDexRouter.WETH();

        _approve(address(this), address(defaultDexRouter), tokenAmount);

        // make the swap
        defaultDexRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(defaultDexRouter), tokenAmount);

        // add the liquidity
        defaultDexRouter.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            liquidityWallet,
            block.timestamp
        );
    }
